import React from 'react';
import './App.css';
import Student from "./pages/Student"
import Home from "./pages/Home"
import Company from "./pages/Company"
import Admin from "./pages/Admin"
import Error from "./pages/Error"
import Navbar from "./components/Navbar"
import Allcompanydata from './components/Allcompanydata';
import Studentprofile from './components/Studentprofile';

import { Route, Switch } from "react-router-dom"
import Allstudentsdata from './components/Allstudentsdata';


function App() {
  return (
    <>
      <Navbar />
      <Switch>
        <Route exact path="/" component={Home} />
        <Route exact path="/admin/" component={Admin} />
        <Route exact path="/company" component={Company} />
        <Route exact path="/student/" component={Student} />
        <Route exact path="/student/allcompanydata" component={Allcompanydata} />
        <Route exact path="/student/allstudentdata" component={Allstudentsdata}  />
        <Route exact path="/student/studentprofile" component={S}  />
        <Route component={Error} />
      </Switch>
    </>
  );
}

export default App;
